text:
Продовжуємо розповідати вам про наші плани: одним з пунктів програми партії «Слуга Народу» є енергетика і тарифоутворення. Готуємо конкретні кроки:

👉 Запровадимо державну стратегію оптимізації житлово-комунальних тарифів за рахунок демонополізації енергетичних ринків, розвитку власного видобутку енергоресурсів та усунення корупційної складової у тарифоутворенні;
👉  Створимо умови для розвитку «зеленої» енергетики з одночасним запобіганням ризикам монополізації галузі через тарифну підтримку невеликим та приватним виробникам відновлювальної енергії;
👉 Створимо умови для виникнення в енергетиці конкурентних вільних ринків, простих швидких процедур, максимально конкурентного ринку видобутку традиційних енергоносіїв із залученням великих міжнародних інвесторів. Залучимо іноземні компанії для видобутку газу і транспортуванню його до Європи через газотранспортну систему;
👉 Інтегруємо українські енергетичні ринки з європейськими;
👉 Доб’ємося повноцінного енергетичного «безвізу» з Європою;
👉 Скасуємо всі формульні ціноутворення на кшталт «Роттердам+» або «Дюссельдорф+» в енергетичній галузі;
👉 Створимо умови для забезпечення споживача правом вибору постачальника енергії та розвиток конкуренції між ними;
👉 Усунемо несправедливе тарифоутворення: бідні не повинні платити за багатих;
👉 Природні монополії залишаться під контролем держави та отримають всі необхідні стимули для мінімізації вартості своїх послуг до споживача.

Ці кроки покращать сферу енергетики та тарифоутворення в державі. Але якщо ви маєте ідеї щодо реформ у цій сфері — пишіть у коментарі! ☝️

Одним з пунктів програми партії «Слуга Народу» є захист довкілля. Ця сфера потребує дуже детального обговорення, тому ми вже маємо конкретні кроки до змін: 

— Запровадимо державну політику екологічних інвестицій, яка включатиме стимули для будівництва сміттєпереробних заводів, сортувальних ліній, створення технологій відновлювальної енергетики;
—  Створимо систему моніторингу довкілля в режимі реального часу;
—  Запровадимо електронне маркування дерев для протидії незаконним вирубкам лісів;
— Заборонимо ввіз до України небезпечних відходів, екологічно небезпечних технологій, трансгенних рослин;
— Запровадимо кримінальну відповідальність за незаконну вирубку лісів та грубі порушення правил поводження з відходами;
— Запровадимо обов'язкове сортування відходів;
— Створимо електронну систему надання дозвільної документації користувачам надр;
— Запровадимо систему ліцензування видобутку бурштину та інших природних ресурсів, які сьогодні розкрадаються, створюючи шкоду для довкілля.

Якщо ви маєте бачення щодо захисту довкілля та реформування цієї сфери — пишіть у коментарі!

Завдяки вам та інформації, яку ви надсилали на сайт та до чатботу, результати пост-праймеріз стали більш прозорими та правильними. Сьогодні на з’їзді було вирішено виключити зі списку деяких кандидатів на підставі надісланої інформації:
⠀
— Боярчук Роман Михайлович (№71);
— Вітікач Віталій Вікторович (№177);
— Кавун Ольга Олександрівна (№78);
— Соколов Михайло Юрійович (№99);
— Рагімова Анастасія Борисівна (№170).
Також двоє звернулись до голови партії із заявою про виключення зі списку за власним бажанням:
— Баланюк Юрій Вікторович (№164)
— Коробкова Олена Анатоліївна (№31).
⠀
Дякуємо за вашу активність та бажання стати краще разом, змінити країну разом. І тільки разом ми будемо йти далі та приймати важливі рішення! 💪

Ми не дамо зірвати вибори!

Політична партія «Слуга Народу» подала в Касаційний суд апеляцію на рішення суду щодо повторного жеребкування. Лише так ми можемо захистити права виборців!

Адже зміни номерів у списках можуть принести вкрай негативні наслідки:
👉 Спотворення волі виборців, серед яких партії вже певний час поширюють матеріали передвиборної агітації із зазначенням номерів їх назв у виборчих бюлетенях;
👉 Неможливість передруку виборчих бюлетенів для голосування у багатомандатному виборчому окрузі та, відповідно, неможливість проведення голосування на позачергових виборах 21 липня 2019 року;
👉 Безрезультатні та безповоротні витрати коштів Державного бюджету України, коштів виборчих фондів політичних партій.

5 принципів партії «Слуга Народу»:
⠀
👉 Держава — не господар, а інструмент і сервіс для громадянина і суспільства. Вона концентрується на своїх головних завданнях: безпека, оборона, дипломатія, забезпечення верховенства права;
👉 Основа успіху України — особиста та економічна свобода людини та громади від свавілля бюрократії, олігархії та монополій;
👉 Знищення системної корупції у владі через невідворотність покарань, скорочення контролюючих органів та функцій чиновників, ефективні антикорупційні служби;
👉 Держава відповідальна за створення умов для розвитку інновацій та впровадження новітніх технологій в економіку, державне управління і громадське життя;
👉 Україна має бути надійним міжнародним партнером для своїх друзів та союзників у світі.
⠀
Ми формували свої принципи відповідно до принципів, визначених президентом та підтриманих українським народом, тому лише за ними будемо вести свою діяльність у Верховній Раді! ☝️

Одним з пунктів програми партії «Слуга Народу» є створення кращих умов для бізнесу. Ми маємо конкретний план для досягнення цілей, створили комітети, які обговорюють законопроєкти і вже формуємо підтримку для наступних кроків.
⠀
Щоб треба зробити:
⠀
👉 Провести функціональний аудит і за його підсумками знизити кількість непотрібних державних органів та непотрібних державних функцій;
👉 Створити можливість одноразової легалізації капіталів некримінального походження за пільговою ставкою;
👉 Запровадити податок на виведений капітал а також стратегію поступового зниження єдиного соціального внеску;
👉 Запровадити фіскальну політику із низьким адміністративним тиском і ліберальним податковим навантаженням;
👉 Позбавити Державну фіскальну службу правоохоронної функції, залишивши їй лише функцію сервісу;
👉 Запровадити єдиний рахунок для сплати податків, повністю переведемо податкові процедури у цифрову форму;
👉 На законодавчому рівні створити незмінність існуючих умов оподаткування для суб’єктів малого підприємництва — фізичних осіб;
👉 Провести валютну лібералізацію, усунемо обмеження для вільного руху капіталів, у тому числі — для швидкого повернення інвестицій;
👉 Створити умови для комфортного ведення бізнесу, у тому числі — легку процедуру електронного відкриття та закриття бізнесу, забезпечення захисту міноритарних акціонерів та корпоративної прозорості, скорочення процедур у будівництві та відведенні землі;
👉 Змінити фокус роботи перевіряючих органів з контролю і штрафів до консультування бізнесу, як зробити підприємство безпечним і правильним;
👉 Завершити роздержавлення економіки шляхом приватизації державних підприємств за виключенням мінімальної кількості критично важливих для оборони та безпеки країни.
⠀
Ці кроки кардинально полегшать можливість створити власний бізнес і ростити вже наявний. Якщо ви маєте бачення кращих умов для бізнесу — пишіть у коментарі! ☝️

У врегулюванні конфлікту на Донбасі зацікавлені не всі політичні сили. Сьогодні пройшов круглий стіл, на якому були озвучені гучні та правильні тези від учасників та членів партії:

— Протягом останніх п’яти років влада спекулювала на темі припинення війни на Донбасі, використовуючи її для власного піару;
— Це дуже важкий і не швидкий процес. Говорити, що проблема може бути вирішена завтра, — це неправда. Потрібно бути відвертим і перед собою, і перед українським суспільством, що це важкий процес;
— Важливим аспектом у питанні повернення Донбасу є інформаційна політика. Вся інформація, яку отримують мешканці Донеччини, найчастіше виходить з російських телеканалів. Нам потрібно повернути цих людей ментально, а потім зайнятися економічним розвитком територій;
— Створення спільної платформи «Нова політика на Донбасі» допоможе започаткувати діалог між владою та громадянами, які проживають на окупованих територіях.
— Є багато напрацьованих ідей і проєктів. Тому ми розпочинаємо цей серйозний діалог з громадянами

Бо головне у державі — це наші люди. Території — це важливо, але території без людей, це — лише території!

Хочемо ще раз перевірити ваші знання: як добре ви знаєте програму партії? Знаходьте у списку та пишіть у коментарі пункт, який не відповідає нашим планам з перебудови держави пункту захисту довкілля:

🔸 Створимо законодавчі стимули для будівництва сміттєпереробних заводів;
🔸 Запровадимо електронне маркування дерев для протидії незаконним вирубкам лісів;
🔸 Запровадимо державні програми системних контактів із зарубіжними підприємствами;
🔸 Запровадимо кримінальну відповідальність за незаконну вирубку лісів та грубі порушення правил поводження з відходами.

Якщо ви сумніваєтесь у своїх знаннях, шукайте підказки на офіційних сторінках соцмереж партії! ☝️

Партія «Слуга Народу» вимагає через суд, щоб ЦВК не допустило появу в бюлетенях інформації про партійність кандидатів-клонів, які збрехали про свою належність до партії. 

З відповідним позовом ми звернулись до Шостого апеляційного адміністративного суду з проханням:

«Зобов’язати Центральну виборчу комісію внести зміни до постанови від 26 червня 2019 року № 1345 «Про форму, колір і текст виборчого бюлетеня  з виборів народних депутатів України для голосування  у загальнодержавному багатомандатному виборчому окрузі  на позачергових виборах народних депутатів України  21 липня 2019 року» та вказати відомості про партійність таких кандидатів у народні депутати України, які включені до виборчих бюлетенів для голосування в одномандатних виборчих округах:
✓ в одномандатному виборчому окрузі № 206 Третяка Сергія Вікторовича;
✓ в одномандатному виборчому окрузі № 94 Підгурського Миколу Миколайовича;
✓ в одномандатному виборчому окрузі № 133 Зелінського Олександра Вікторовича;
✓ в одномандатному виборчому окрузі № 206 Косяна Сергія Сергійовича;
✓ в одномандатному виборчому окрузі № 133 Анциферова Дмитра Юрійовича;
✓ в одномандатному виборчому окрузі № 133 Гринько Альони Анатоліївни;
✓ в одномандатному виборчому окрузі № 133 Дмитрука Артема Ярославовича;
✓ в одномандатному виборчому окрузі № 199 Бойка Олега Леонідовича;
✓ в одномандатному виборчому окрузі № 145 Петровця Олега Федоровича, - шляхом зазначення таких відомостей - «безпартійний».

Суд розгляне позов сьогодні. Чекаємо на результат!

Ми оновили наш Telegram-бот 👉 https://t.me/SlugaNarodu_Official! 

До всіх функцій додали ще одну: тепер за 30 секунд ви можете знайти кандидата від партії. Як це працює:

— Натисніть «Мій округ»;
— Напишіть номер округу; 
— Бот покаже справжнього кандидата по вашому округу. 

Перевіряйте та надсилайте друзям. Довіряйте лише офіційній інформації!

• Вони контролюють 80% телевізійного простору;
• Вони використовують політиків для захисту своїх інтересів;
• Доходи їхніх компаній – це 10 річних бюджетів на освіту або 12 – на оборону;
• Вони монополізували найвигідніші державні ринки і контролюють 30% української економіки.

Хто це? Дейнеріс і дракони? Дарт Вейдер з Палпатіном? Лорд Волдеморт чи, може, сам Танос? Ні, це українські олігархи!  

Бермудський трикутник «гроші-медіа-влада» треба знищити. Олігархи мають стати звичайними бізнесменами. І ми знаємо як це зробити.

Не хочеш, щоб олігархи визначали твоє життя? Для початку пройди наш тест, а 21 липня проголосуй за «Голос». Ми — за деолігархізацію!

5 перших принципів партії «Слуга Народу»:
🔹Вільний, заможний та щасливий українець — головна мета діяльності української держави. Життя і добробут людини — найвища цінність для неї;
🔹Справжня демократія — це народовладдя, кожен громадянин повинен мати можливість впливати на рішення, що приймаються на державному та місцевому рівні;
🔹Рух України до НАТО і ЄС — не кінцева мета, а засіб побудови в країні сучасної економіки, справжньої демократії та впровадження верховенства права;
🔹Запорука майбутнього України — вільна економіка, в якій держава виступає гарантом прав власності, забезпечує чіткий та рівні правила гри для всіх, залучає інвестиції та стимулює інновації;
🔹Незалежний та справедливий суд, який керується правом і законом — цивілізований інструмент для вирішення спорів, а не засіб тиску на людину, громаду і бізнес.

Ми будемо вести свою діяльність у Верховній раді лише відповідно до принципів, визначених президентом та підтриманих українським народом. Кардинальні зміни вже у дії!

Ми створили Telegram-бота — https://t.me/SlugaNaroduHelpBot, що стане вашим помічником у вирішенні будь-якого запиту в рамках діяльності партії.

Бот може говорити українською та російською мовами. Має зручний функціонал та пояснення до кожного кроку. Його функції щодня модернізуються. Зараз він 24 години на добу готовий допомогти вам:
— знайти офіційну програму партії;
— відшукати всі оновлені списки партії та списки по мажоритарних округах;
— лишити будь-який відгук про кандидатів партії;
— переглянути результат розгляду заявки;
— знайти офіційні сторінки партії в соціальних мережах;
— поставити специфічне питання менеджерам, які оброблять його та дадуть вичерпну відповідь.

Більш того, бот може відправляти вам свіжі новини, треба лише натиснути відповідну кнопку.

Одним з пунктів програми партії «Слуга Народу» є знищення системної корупції. 

Це не просто слова, адже ми маємо конкретний план для досягнення цілей. Для цього вже формуємо підтримку: неможливо підробити документи в електронній базі, неможливо провести транзакцію заднім числом, якщо вона в онлайні тощо. 
Наші кроки: 

— Створимо повноцінну національну систему електронного врядування;
— Зробимо радикальне очищення і перезавантаження прокуратури;
— Забезпечимо реальну незалежність антикорупційних органів;
— Переведемо максимально можливу кількість державних послуг до онлайну;
— Посилимо відповідальність за корупційні злочини — впровадимо обов'язкову конфіскацію майна корупціонерів;
— Створимо систему захисту свідків та запровадимо систему грошової винагороди для громадян за виявлену корупцію; 
— Будь-яке розслідування стосовно бізнесу буде ґрунтуватися на принципі презумпції доброчесності;
— Ухвалимо сучасне законодавство про тимчасові слідчі комісії Верховної Ради, що дозволить притягати до відповідальності корумпованих та некомпетентних чиновників.

Якщо ви маєте бачення вирішення проблем корупції — пишіть у коментарі!

Перевіримо, як добре ви знаєте програму партії «Слуга Народу»? Читайте, знаходьте у списку та пишіть у коментарі пункт, який не відповідає нашим планам з перебудови держави.

— Позбавимо власників медіа можливості впливати на те, що говорять чи пишуть журналісти;
— Законодавчо врегулюємо право володіння зброєю;
— Переведемо всі соціальні пільги у грошову форму, щоби поліпшити фінансовий стан і одночасно — організацій, які надають послуги;
— Запровадимо політику підтримки сучасного міжнародного кіно- та образотворчого мистецтва та пропагування міжнародного креативного продукту;
— Скасуємо всі формульні ціноутворення на кшталт «Роттердам+» в енергетичній галузі.

Якщо ви сумніваєтесь у своїх знаннях, шукайте підказки на офіційних сторінках соцмереж партії!
